import "./Toggle.css";
import { TiAdjustContrast } from "react-icons/ti";

export const Toggle = ({ handleChange }) => {
    return (
        <div className="toggle-theme-container">
            <button
                type="button"
                className="toggle-theme-btn"
                onClick={handleChange}
            >
                <TiAdjustContrast className="theme-icon" />
            </button>
        </div>
    );
};
